let curTime = new Date();
curTime = curTime.toLocaleTimeString();

const App = () => {
    return (
        <>
           <div>
           <h1 className='times'>{curTime}</h1>
            <button>GET TIME</button>
           </div>
        </>
    )
}

export default App;
